import {React, useState} from 'react'
import { useAuth } from '../auth'
const LogIn = () => {
    const [user, setUser] = useState("")
    const auth = useAuth()
    const handleLogin = () => {
        auth.login(user)
    }
    return (
        <div>
            <label>
                Username: {' '}
                <input type="text" onChange={(e) => setUser(e.target.value)} />
            </label>
            <button onClick={handleLogin}>LogIn</button>
        </div>
    )
}

export default LogIn
